import React from 'react';

function Section_Dessert() {
	const path = process.env.PUBLIC_URL;
	const [Dessert, setDessert] = useState([]);

	useEffect(() => {
		axios.get(`${path}/DB/dessert.json`).then((json) => {
			setDessert(json.data.dessert);
		});
	}, []);

	return (
		<figure id='dessert'>
			<div className='pic'>
				<div className='img'></div>
				<h1>
					HOMEMAED
					<br />
					BAKERY
				</h1>
			</div>
			<div className='inner'>
				<div className='wrap'>
					{Dessert.map((dessert, idx) => {
						return (
							<article key={idx}>
								<div className='pic'>
									<img src={`${path}/img/${dessert.pic}`} alt={dessert.name} />
								</div>
								<h3>{dessert.title}</h3>
								<p>{dessert.sub}</p>
							</article>
						);
					})}
				</div>
			</div>
		</figure>
	);
}

export default Section_Dessert;
